function [sr,sr_udg] = source(p,udg,param,time)

[ng,nc] = size(udg);
nch = nc/3;

sr = zeros(ng,nch);
sr_udg = zeros(ng,nch,nc); 

%[S, JS] = source2(udg, param, p(:,3));
% sr(:,end) = S;
% sr_udg(:,end,:) = JS;

b   = 20;
Re  = param{3};
rN  = udg(:,5);
chi = rN.*Re;

in1 = b*chi>b;
[S1, JS1] = source2(udg(in1,:), param, p(in1,3));
sr(in1,end) = S1;
sr_udg(in1,end,:) = JS1;

in2 = logical(round(1-in1));
%[S2, JS2] = source3(udg(in2,:), param, p(in2,3), b);
